css:
.linter-summary:hover {
  cursor: pointer;
}
.linter-summary:hover > div {
  color: #c8d5ee;
}
.linter-summary .icon-right {
  visibility: visible;
}
.linter-summary .icon-right:before {
  font-family: 'Octicons Regular';
  opacity: 0.6;
  content: "\f052";
  font-size: 1.1em;
  padding: 0 .1em;
  margin-right: .3em;
}
.linter-summary .linter-info .icon-right:before {
  color: #6494ed;
}
.linter-summary .linter-warning .icon-right:before {
  color: #e2c08d;
}
.linter-summary .linter-error .icon-right:before {
  color: #ff6347;
}
